// src/utils/translations/index.js

import enUS from './en-US';
import esES from './es-ES';
import frFR from './fr-FR';

// Export all translations in a single object
const translations = {
  'en-US': enUS,
  'es-ES': esES,
  'fr-FR': frFR,
  // Add more languages as needed
};

export default translations;
